import React from 'react';
import { View, Text, StyleSheet, Image } from 'react-native';

const Navbar = () => {
  return (
    <View style={styles.navbar}>
      <Image
        source={require('../assets/img/GIcon.png')}
        style={styles.logo}
        resizeMode="contain"
      />
      <Text style={styles.navbarText}>Mi App</Text>
    </View>
  );
};

const styles = StyleSheet.create({
  navbar: {
    backgroundColor: 'red',
    flexDirection: 'row',
    padding: 10,
    alignItems: 'center',
    justifyContent: 'center',
  },
  logo: {
    width: 30, 
    height: 30, // ajusta el tamaño según sea necesario
    marginRight: 10, // ajusta el margen según sea necesario
  },
  navbarText: {
    color: '#000', // texto negro
    fontSize: 20,
    fontWeight: 'bold',
  },
});

export default Navbar;
